import RealTimerReport from '../../../core/report'


export default class LockerStatusReport extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }
    columns = [
        { title: 'Tòa nhà', field: '' },
        { title: 'Tầng', field: '' },
        { title: 'Tủ', field: '' },
        { title: 'Trạng thái', field: '' },
        { title: 'Người sử dụng cuối cùng', field: '' },
        { title: 'ID nhân sự', field: '' },
        { title: 'Thời điểm thao tác lần cuối', field: '' },
    ]

    options = {
        search: false,

    }

    componentDidMount() {
    }

    render() {
        return(
            <div>
                <MaterialTable 
                title = 'Báo cáo trạng thái các tủ đang hoạt động trong hệ thống'
                columns = {this.columns}
                options = {this.options}/>
            </div>
        )
    }
}
